import { Card } from 'antd'
import React from 'react'
import styled from "@emotion/styled";

const CardContent = styled.div`
  width:100%;
  height:100%;
`

const Main = ({title}) => {
  return (
    <div>
      <Card title={title} bordered={true} style={{boxShadow:'rgba(0, 0, 0, 0.35) 2px 2px 6px'}}>
        <CardContent>
          <p>Card content</p>
          <p>Card content</p>
          <p>Card content</p>
        </CardContent>
      </Card>
    </div>
  )
}

export default Main
